import './App.css';

const  App = () =>{
  return(
    <div classname = 'app-wrapper'>
      <header>
        <img src = 'https://w7.pngwing.com/pngs/813/735/png-transparent-bird-of-prey-logo-beak-desktop-bird-animals-computer-logo.png'></img>
      </header>
      <nav>
        <div>
          Profile
        </div>
        <div>
          Messages
        </div>
        <div>
          Main content
        </div>
      </nav>
    </div>
  )
}

export default App;
